import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      const newData = data
      result.forEach(item => {
        newData.push(item)
      })
      return newData
    })
    .then(
      newData => {
        setData(newData)
        console.log(data[0].first_name)
      }
    )
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
  {data.forEach(item => <div>{item.first_name}</div>)}
    </div>
  </div>
  )
}

export default HomePage
